import React, {Component} from 'react';
import './AboutMe.css';

class AboutMe extends Component {
    state = {  }
    render() { 
        return ( 
            <div className="divStyle">
                <div className="divAboutMeHeader" >
                   <h1 className="divAboutMeHeader" >  About Me</h1>
                </div>
                <div className="divAboutMeDetails">
                    <p>
                    I enjoy the challenges and problem solving specially when I have to code. Ever since I first started learning C, I found my interest in writing the code. I love the process of figuring out the logic/algorithm and implement it to design a beautiful solution.

                    In my professional experience of 10 years with Infosys, I was presented lot of opportunities to showcase my skills. I started as a systems developer and within 3 years I moved into a technology analyst role after 2 promotions. I was involved in various software development and maintenance projects with multiple banking and financial clients. During my 3+ years of assignment in Charlotte, I solely handled the onshore part of the application which also include detailed analysis, code walk through/presentations, deployment and production support.

                    Currently being a graduate student in University of Georgia, I am doing my research to support multi paradigm data modelling using Scala. My thrive towards learning new skills and build efficient products is perpetual.
                    </p>

                </div>
            </div>
         );
    }
}

export default AboutMe;
